    'components.presentational.Pages.About.Wanderbeat.title': 'Wanderbeat',
    'components.presentational.Pages.About.Wanderbeat.text': 'WANDERBEAT - \u043C\u0435\u0436\u0434\u0443\u043D\u0430\u0440\u043E\u0434\u043D\u044B\u0439 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u044B\u0439 \u043F\u043E\u0440\u0442\u0430\u043B \u0441 \u043E\u0433\u0440\u043E\u043C\u043D\u044B\u043C \u0441\u043F\u0435\u043A\u0442\u0440\u043E\u043C \u0443\u0441\u043B\u0443\u0433\n      \u0438 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u0435\u0439 \u0432 \u043C\u0438\u0440\u0435 \u043C\u0443\u0437\u044B\u043A\u0438. \u0421\u0435\u0440\u0432\u0438\u0441 \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u0435\u0442 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0442\u044C \u0438 \u043F\u0440\u043E\u0434\u0432\u0438\u0433\u0430\u0442\u044C \u0441\u0435\u0431\u044F \u0432\n      \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u043E\u0439 \u0438\u043D\u0434\u0443\u0441\u0442\u0440\u0438\u0438. \u0412\u044B \u043C\u043E\u0436\u0435\u0442\u0435 \u043F\u0443\u0431\u043B\u0438\u043A\u043E\u0432\u0430\u0442\u044C \u0441\u0432\u043E\u0438 \u0442\u0440\u0435\u043A\u0438 \u0441 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C\u044E \u043F\u043E\u043A\u0443\u043F\u043A\u0438 \u0438\n      \u043F\u0440\u043E\u0434\u0430\u0436\u0438, \u0437\u0430\u0433\u0440\u0443\u0436\u0430\u0442\u044C \u0441\u0432\u043E\u0438 \u043C\u0438\u043A\u0441\u044B, \u0444\u043E\u0442\u043E, \u0432\u0438\u0434\u0435\u043E, \u0441\u043E\u0437\u0434\u0430\u0432\u0430\u0442\u044C \u043F\u043E\u0434\u043A\u0430\u0441\u0442\u044B, \u043F\u0440\u043E\u0434\u0432\u0438\u0433\u0430\u0442\u044C\n      \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0435 \u043C\u0435\u0440\u043E\u043F\u0440\u0438\u044F\u0442\u0438\u044F! \u041A\u0430\u0436\u0434\u044B\u0439 \u0438\u0437 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u0435\u0439 \u043F\u043E\u043B\u0443\u0447\u0430\u0435\u0442 \u043C\u0438\u043D\u0438\u043C\u0443\u043C 1 \u0433\u0438\u0433\u0430\u0431\u0430\u0439\u0442\n      \u0441\u0432\u043E\u0431\u043E\u0434\u043D\u043E\u0433\u043E \u043C\u0435\u0441\u0442\u0430 \u0434\u043B\u044F \u043F\u0440\u043E\u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F \u0438 \u043F\u0443\u0431\u043B\u0438\u043A\u0430\u0446\u0438\u0438 \u0441\u0432\u043E\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u043E\u0432, \u0430 \u043E\u0431\u043B\u0430\u0434\u0430\u0442\u0435\u043B\u0438\n      PRO-\u0430\u043A\u043A\u0430\u0443\u043D\u0442\u043E\u0432 \u2014 \u0431\u0435\u0437\u043B\u0438\u043C\u0438\u0442\u043D\u043E\u0435 \u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0441\u0442\u0432\u043E \u0438 \u0440\u044F\u0434 \u043F\u0440\u0435\u0438\u043C\u0443\u0449\u0435\u0441\u0442\u0432 \u043F\u0435\u0440\u0435\u0434 \u043E\u0441\u0442\u0430\u043B\u044C\u043D\u044B\u043C\u0438\n      \u0430\u043A\u043A\u0430\u0443\u043D\u0442\u0430\u043C\u0438. \u0421\u0435\u0440\u0432\u0438\u0441\u043E\u043C \u0432\u044B \u0441\u043C\u043E\u0436\u0435\u0442\u0435 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C\u0441\u044F \u0441\u043E \u0432\u0441\u0435\u0445 \u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0445 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432,\n      \u0432\u0435\u0434\u044C \u043C\u044B \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0435\u043C \u0432\u0441\u0435 \u043F\u043B\u0430\u0442\u0444\u043E\u0440\u043C\u044B!',

